    required TResult Function(HomeError value) error,
    required TResult Function(HomeInitial value) homePage,
    required TResult Function(WalletPageState value) walletPage,
    required TResult Function(HistoryPageState value) historyPage,
    required TResult Function(ProfilePageState value) profilePage,
  }) {
    return profilePage(this);
  }

  @override
  @optionalTypeArgs
  TResult? mapOrNull<TResult extends Object?>({
    TResult? Function(HomeLoading value)? loading,
    TResult? Function(HomeError value)? error,
    TResult? Function(HomeInitial value)? homePage,
    TResult? Function(WalletPageState value)? walletPage,
    TResult? Function(HistoryPageState value)? historyPage,
    TResult? Function(ProfilePageState value)? profilePage,
  }) {
    return profilePage?.call(this);
  }

  @override
  @optionalTypeArgs
  TResult maybeMap<TResult extends Object?>({
    TResult Function(HomeLoading value)? loading,
    TResult Function(HomeError value)? error,
    TResult Function(HomeInitial value)? homePage,
    TResult Function(WalletPageState value)? walletPage,
    TResult Function(HistoryPageState value)? historyPage,
    TResult Function(ProfilePageState value)? profilePage,
    required TResult orElse(),
  }) {
    if (profilePage != null) {
      return profilePage(this);
    }
    return orElse();
  }
}

abstract class ProfilePageState implements HistoryState {
